import React from "react"
import {Link} from "react-router-dom"
import dateFormat from 'dateformat';
import Accordion from "@material-ui/core/Accordion";
import AccordionDetails from "@material-ui/core/AccordionDetails";
import AccordionSummary from "@material-ui/core/AccordionSummary";
import { NavLink } from "react-router-dom";
import dompurify from 'dompurify'

function RegistrationTile(props){

    return(
        <div id={"registration" + props.Registration.BPEventID} className="full-row">
        <div className="container-fluid">
          <div className="row align-items-center light-gray p-4 pb-3 mb-5">
            <div className="col-md-8 col-12">
              <p><strong>{props.Registration.RegistrationName}</strong><br/>
              {<div dangerouslySetInnerHTML={{ __html: dompurify.sanitize(props.Registration.RegistrationDescription) }} /> }
                </p>
            </div>
            <div className="col-md-2 col-6">
              <div className="form-group">
                <label id="" className="control-label editing-form-label" for="">Quantity</label>
                <select name="" id="" className="DropDownField form-control">
                  <option value="0">0</option>
                  <option value="1">1</option>
                </select>
              </div>
            </div>
            <div className="col-md-2 col-6"> <Link className="button-default" to={"/events/register/" + props.Registration.BPEventID}>Register</Link> </div>
          </div>
        </div>
      </div>
    )
}

export default RegistrationTile;
